import React from "react";
import ReactDOM from "react-dom";
import Sdata from "./Sdata"
import Card from "./Cards";

console.log(Sdata[0]);

ReactDOM.render(
                <>
                <h1>List of Top 5 Netflix web Series</h1>


                  <Card imgSrc={Sdata[0].img} 
                        title={Sdata[0].title}
                        sname={Sdata[0].name} 
                        link={Sdata[0].link}/>

                  <Card imgSrc={Sdata[1].img} 
                        title={Sdata[1].title}
                        sname={Sdata[1].name} 
                        link={Sdata[1].link}/>

                  <Card imgSrc={Sdata[2].img} 
                        title={Sdata[2].title}
                        sname={Sdata[2].name} 
                        link={Sdata[2].link}/>

                  <Card imgSrc={Sdata[3].img} 
                        title={Sdata[3].title}
                        sname={Sdata[3].name} 
                        link={Sdata[3].link}/>

                  <Card imgSrc={Sdata[4].img} 
                        title={Sdata[4].title}
                        sname={Sdata[4].name} 
                        link={Sdata[4].link}/>
                </>,
                document.getElementById("root")

);
